import { BrowserRouter, Routes, Route} from "react-router-dom"
//import { Button } from 'antd';
import PocetnaStranica from "./pages/PocetnaStrana";
import PreviewList from "./pages/PreviewList";
import CreatedList from "./pages/CreateList";


function App() {
  return (



    <div>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<PocetnaStranica/>}/>
        <Route path="/CreateList" element={<CreatedList/>}/>
        <Route path="/PreviewList" element={<PreviewList/>}/>
      </Routes>
      </BrowserRouter>
    </div> 

  );
}

export default App;
